import React from "react";

const Navbar = () => {
    return (
        <div className='text-white'>
            <h1 className='w-full text-3xl font-bold text-[#00df9a]'>PRINTXPRESS.</h1>
            <ul>
                <li>Home</li>
                <li>Company</li>
                <li>Resources</li>
                <li>About</li>
                <li>Contact</li>
            </ul>
        </div>
    )
}

export default Navbar;
